    const {note} = useContext(Context)

    return (
        <Container>
            {/* <Row className="mt-3">
                <Col md={12}>

                </Col>
            </Row> */}
            <ListGroup>
                {note.notes.map(note => <Note key={note.id} note={note} />)}
            </ListGroup>
        </Container>
    );
};

export default List;
